import { ReactComponent as ProfileIcon } from 'assets/img/profile.svg';
import './styles.css'
//import 'bootstrap/dist/css/bootstrap.css';

function Navbar() {
    return (
        <header>
            <nav className="container">
                <div className="market-nav-content">
                    <h1>Marketplace</h1>
                    <h1>
                        <input className="form-control" type="search" placeholder="Search..." />
                        <div className="market-form-btn-container">
                        <button className="btn btn-primary dsmovie-btn" type="submit">Ok</button>
                    </div> 
                    </h1>
                                       
                    <a href="https://github.com/maquison/marketplace-kotlin-react">
                        <div className="market-profile-container">
                            <ProfileIcon className="market-icon-container"/>
                            <p className="market-profile-link">Profile</p>
                        </div>
                    </a>                    
                    <form className="dropdown-menu">
                        
                        <button className="btn btn-primary dsmovie-btn" type="submit">Ok</button>
                    </form>
                    
                    
                    
                </div>
            </nav>
        </header>
    );
}

export default Navbar;
